            "in": "header",
            "name": "Cookie",
            "schema": {
              "type": "string"
            }
          }
        ],
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "$ref": "#/components/schemas/submitSelfServiceSettingsFlowBody"
              }
            },
            "application/x-www-form-urlencoded": {
              "schema": {
